	<style type="text/css">
		body{
			/*background-color: rgb(222,216,216);*/
		}
		#border-animation{
			width: 740px;
		    height: 555x;
		    position: absolute;
		    top:100;
		    left:400;
		    overflow: hidden;
		    /*background: white;*/
		}		 
		svg{
		    position: absolute;
		    top: 0;
		    left: 0;
		}		 
		#logo{
			opacity: 0;
			-webkit-animation:logo 10s ease-in-out 5s forwards paused;
		}
		@-webkit-keyframes logo{
			from{
				opacity: 0;
			}
			to{
				opacity: 1;
			}
		}
		#text{
			stroke-dashoffset:11722;
			stroke-dasharray:11722 11722;
			-webkit-animation:borderT 20s ease-in-out 2s forwards paused;
		}
		#cube{
			stroke-dashoffset: 11618;
			stroke-dasharray: 11618 11618;
			/*-webkit-transition: stroke-dashoffset 10s ease-in-out;*/
			-webkit-animation: borderC 20s ease-in-out forwards paused; 
		}	
		/*#border-animation:hover path{
			stroke-dashoffset:0;
		}*/
		@-webkit-keyframes borderT{
			0%{
				stroke-dashoffset:11722;
			}
			99%{
				stroke-dashoffset:0;
			}
			100%{
				opacity:0;
			}
		}
		@-webkit-keyframes borderC{
			0%{
				stroke-dashoffset:11618;
			}
			99%{
				stroke-dashoffset:0;
			}
			100%{
				opacity:0;
			}
		}
		/*#border-animation:hover .top{
		    -webkit-transform: translateX(-200px);
		    transform: translateX(-400px);
		}	
		#border-animation:hover .right{
		    -webkit-transform: translateY(-200px);
		    transform: translateY(-400px);
		}	
		#border-animation:hover .bottom{
		    -webkit-transform: translateX(200px);
		    transform: translateX(400px);
		}		
		#border-animation:hover .left{
		    -webkit-transform: translateY(200px);
		    transform: translateY(400px);
		}*/

	</style>
	<script type="text/javascript">	
		var img = document.getElementById('logo');		
		var t = document.getElementById('text');
		var c = document.getElementById('cube');
		t.style.WebkitAnimationPlayState="paused";
		c.style.WebkitAnimationPlayState="paused";		
		img.style.WebkitAnimationPlayState="paused";		
		var trial = function(s){
			c.style.WebkitAnimationPlayState="running";
			t.style.WebkitAnimationPlayState="running";
			img.style.WebkitAnimationPlayState="running";				
		}
		var trigger = function(){
			trial("play");		
		}
	</script>
